<h1>md5sum</h1>
<p>md5sum file(s)</p>
<h1>Syntax</h1>
<pre>md5sum &lt;file&gt; &lt;file&gt;...
</pre>

<h1>Description</h1>
<p>The md5sum command generates an md5sum of a (list of) flash file(s).</p>
<h1>Examples</h1>
<pre>server:$ md5sum loader.bin
956b162cd81e7012539fde525c8372a4  loader.bin
</pre>
